import React from "react";
import SideIcons from "./SideIcons";
import ThemeContext from '../ThemeContext';


function NavBar(props) {
    return <ThemeContext.Consumer>
        {(value) =>
            <div className={"navbar " + value.theme}>
                <SideIcons type="head" name="Home" click={props.function} />
                <div className="navbar-icons">
                    <ul className="navbar-list">
                        <SideIcons type="text" name="About" click={props.function} />
                        <SideIcons type="text" name="Skills" click={props.function} />
                        <SideIcons type="text" name="Experience" click={props.function} />
                        <SideIcons type="text" name="Projects" click={props.function} />
                        <SideIcons type="text" name="Contact" click={props.function} />
                    </ul>
                </div>
            </div>
        }
    </ThemeContext.Consumer>
}

export default NavBar;
